// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./Token_v1.sol";
import "./Roles/Wiper.sol";
import "./Util/EIP712.sol";
import "./MetaTransactions.sol";
import "./Permit.sol";

contract Token_v2 is Token_v1, Wiper, MetaTransactions, Permit  {

    bool private _initializedV2;

    event ProhibitedAddressWiped(address indexed addr, uint256 amount);

    // initialize V2
    function initializeV2(string calldata _newName, address _wiper, address _forwarder) external {
        require(
            !_initializedV2,
            "Contract is already initialized"
        );
        //new name
        name = _newName;

        //initialize wiper
        wiper = _wiper;

        DOMAIN_SEPARATOR = EIP712.makeDomainSeparator(name, "2");

        _forwarder;        
        _initializedV2 = true;

    }

    // wipe balance of prohibited address
    function wipeProhibitedAddress(address _account) public whenNotPaused onlyWiper onlyProhibited(_account) {
        uint256 _balance = balanceOf(_account);
        _burn(_account, _balance);
        emit ProhibitedAddressWiped(_account, _balance);
    }
}
